function Layout(props) {
    return (
        <div className="layout">
    
               <Head/>
            <style jsx>{`
                .layout{
                    padding:0px;
        
                    font-size:2rem;
                    color:red;
                    height:100%;
                    width:100%;
                    background-color:red
                }
                `} </style>
            {props.children}
        </div>
        
  )
  
}
export default Layout;
function GlobalHeader() {
    return (
        <Head>
            <title>Trial</title>
            
       </Head>
    )
    
}
